import { TodoListCountMobile } from '../TodoList/todoListCount/TodoListCountMobile';

export function Todo(){

    
    return (
        <div id='todoDiv'>
            <TodoHeader />
            <TodoInput />
            <TodoList />
            <TodoListCountMobile />
        </div>
    )
}
